import React from 'react';
import Link from 'next/link';

const NoticeList = (props, {onChage}) => {

    return (
        <Link href='/noticeDetail'><li key={props.props.NTC_ID} onClick={onChage(props.props.NTC_ID)}>{props.props.NTC_TITLE}</li></Link>
    )
};

export default NoticeList;
